const showData = async function (jsonObject) {
	console.log(jsonObject);
	let html = '';
	let i = 0;
	for (const item in jsonObject) {
		html += `<div class="card-container flipped">
		<div class="card cardnr${cardnr}">
			<div class="front">
			<img class="c-img c-imgnr${cardnr}" src="${jsonObject[i].url}" alt="${jsonObject[i].title}" />
			</div>
			<div class="back">
				<svg viewBox="0 0 300 420">
					<use xlink:href="#card-back" />
				</svg>
			</div>
		</div>
	</div>`;
		i++;
		cardnr++;
	}

	document.querySelector('.c-cards').innerHTML += html;

	listenToClick();
};

const getNewImage = function () {
	if (document.querySelector('.c-cards').childElementCount <= 8) {
		let url = `https://api.nasa.gov/planetary/apod?api_key=${apiKey}&count=1`;
		handleData(url, function (jsonObject) {
			ListjsonObjects.push(jsonObject);
			showData(jsonObject);
		});
	}
};

const getApi = function () {
	if (document.querySelector('.c-cards').childElementCount <= 8) {
		let url = `https://api.nasa.gov/planetary/apod?api_key=${apiKey}&count=8`;
		handleData(url, function (jsonObject) {
			ListjsonObjects.push(jsonObject);
			showData(jsonObject);
		});
	}
};

const listToBoardhover = function () {
	document.querySelectorAll('.card-sm').forEach((card) =>
		card.addEventListener('hover', function (e) {
			console.log(`hover ${e}`);
		})
	);
};

const listenToClick = async function () {
	let cardds = document.querySelectorAll('.card-container');
	for (let i = 0; i < cardds.length; i++) {
		cardds[i].classList.remove('flipped');

		await new Promise((resolve) => setTimeout(resolve, 200));
		checkCards();
	}

	let cards = document.querySelectorAll('.card');
	for (let i = 0; i < cards.length; i++) {
		cards[i].addEventListener('click', function (e) {
			let imgnr = `.c-imgnr${i}`;
			console.log(imgnr);

			showCardOnBoard(document.querySelector(`${imgnr}`).src);
			const str = e.path[3];
			str.remove();
			const result = ListjsonObjects[0].filter(
				(word) => word.url === document.querySelector(`${imgnr}`).src
			);
			const index = ListjsonObjects.indexOf(result[0]);
			ListjsonObjects.remove(index);
			console.log(ListjsonObjects);
		});
	}
};

const listenser = function () {
	document.querySelector('#btn').addEventListener('click', function () {
		loadCards();
	});
};

const checkCards = function () {
	let cards = document.querySelectorAll('.card-container');
	document.querySelectorAll('.card-container').forEach((card) => {
		for (var i = 1; i <= 8; i++) {
			if (card.classList.contains(`card${i}`)) {
				card.classList.remove(`card${i}`);
			}
		}
		if (cards[0]) {
			cards[0].classList.add('card1');
		}
		if (cards[1]) {
			cards[1].classList.add('card2');
		}
		if (cards[2]) {
			cards[2].classList.add('card3');
		}
		if (cards[3]) {
			cards[3].classList.add('card4');
		}
		if (cards[4]) {
			cards[4].classList.add('card5');
		}
		if (cards[5]) {
			cards[5].classList.add('card6');
		}
		if (cards[6]) {
			cards[6].classList.add('card7');
		}
		if (cards[7]) {
			cards[7].classList.add('card8');
		}
	});
};

const loadCards = async function () {
	document.querySelector('.c-cards').innerHTML = '';
	// for (let i = 0; i < 2; i++) {
	getApi();
	document.querySelectorAll('.card-container').forEach((card) => {
		card.classList.remove('flipped');
	});
	await new Promise((resolve) => setTimeout(resolve, 600));
	checkCards();
	// }
};

document.addEventListener('DOMContentLoaded', function () {
	listenser();
});
